// --- atf_ci.FDb.ind_ssimfile.Find
// Find row by key. Return NULL if not found.
atf_ci::FSsimfile* atf_ci::ind_ssimfile_Find(const algo::strptr& key) {
    u32 index = algo::Smallstr50_Hash(0, key) & (_db.ind_ssimfile_buckets_n - 1);
    atf_ci::FSsimfile* *e = &_db.ind_ssimfile_buckets_elems[index];
    atf_ci::FSsimfile* ret=NULL;
    do {
        ret       = *e;
        bool done = !ret || (*ret).ssimfile == key;
        if (done) break;
        e         = &ret->ind_ssimfile_next;
    } while (true);
    return ret;
}

// --- atf_ci.FDb.ind_ssimfile.FindX
// Look up row by key and return reference. Throw exception if not found
atf_ci::FSsimfile& atf_ci::ind_ssimfile_FindX(const algo::strptr& key) {
    atf_ci::FSsimfile* ret = ind_ssimfile_Find(key);
    vrfy(ret, tempstr() << "atf_ci.key_error  table:ind_ssimfile  key:'"<<key<<"'  comment:'key not found'");
    return *ret;
}

// --- atf_ci.FDb.ind_ssimfile.GetOrCreate
// Find row by key. If not found, create and x-reference a new row with with this key.
atf_ci::FSsimfile& atf_ci::ind_ssimfile_GetOrCreate(const algo::strptr& key) {
    atf_ci::FSsimfile* ret = ind_ssimfile_Find(key);
    if (!ret) { //  if memory alloc fails, process dies; if insert fails, function returns NULL.
        ret         = &ssimfile_Alloc();
        (*ret).ssimfile = key;
        bool good = ssimfile_XrefMaybe(*ret);
        if (!good) {
            ssimfile_RemoveLast(); // delete offending row, any existing xrefs are cleared
            ret = NULL;
        }
    }
    vrfy(ret, tempstr() << "atf_ci.create_error  table:ind_ssimfile  key:'"<<key<<"'  comment:'bad xref'");
    return *ret;
}

// --- atf_ci.FDb.ind_ssimfile.InsertMaybe
// Insert row into hash table. Return true if row is reachable through the hash after the function completes.
bool atf_ci::ind_ssimfile_InsertMaybe(atf_ci::FSsimfile& row) {
    ind_ssimfile_Reserve(1);
    bool retval = true; // if already in hash, InsertMaybe returns true
    if (LIKELY(row.ind_ssimfile_next == (atf_ci::FSsimfile*)-1)) {// check if in hash already
        u32 index = algo::Smallstr50_Hash(0, row.ssimfile) & (_db.ind_ssimfile_buckets_n - 1);
        atf_ci::FSsimfile* *prev = &_db.ind_ssimfile_buckets_elems[index];
        do {
            atf_ci::FSsimfile* ret = *prev;
            if (!ret) { // exit condition 1: reached the end of the list
                break;
            }
            if ((*ret).ssimfile == row.ssimfile) { // exit condition 2: found matching key
                retval = false;
                break;
            }
            prev = &ret->ind_ssimfile_next;
        } while (true);
        if (retval) {
            row.ind_ssimfile_next = *prev;
            _db.ind_ssimfile_n++;
            *prev = &row;
        }
    }
    return retval;
}

// --- atf_ci.FDb.ind_ssimfile.Remove
// Remove reference to element from hash index. If element is not in hash, do nothing
void atf_ci::ind_ssimfile_Remove(atf_ci::FSsimfile& row) {
    if (LIKELY(row.ind_ssimfile_next != (atf_ci::FSsimfile*)-1)) {// check if in hash already
        u32 index = algo::Smallstr50_Hash(0, row.ssimfile) & (_db.ind_ssimfile_buckets_n - 1);
        atf_ci::FSsimfile* *prev = &_db.ind_ssimfile_buckets_elems[index]; // addr of pointer to current element
        while (atf_ci::FSsimfile *next = *prev) {                          // scan the collision chain for our element
            if (next == &row) {        // found it?
                *prev = next->ind_ssimfile_next; // unlink (singly linked list)
                _db.ind_ssimfile_n--;
                row.ind_ssimfile_next = (atf_ci::FSsimfile*)-1;// not-in-hash
                break;
            }
            prev = &next->ind_ssimfile_next;
        }
    }
}

// --- atf_ci.FDb.ind_ssimfile.Reserve
// Reserve enough room in the hash for N more elements. Return success code.
void atf_ci::ind_ssimfile_Reserve(int n) {
    u32 old_nbuckets = _db.ind_ssimfile_buckets_n;
    u32 new_nelems   = _db.ind_ssimfile_n + n;
    // # of elements has to be roughly equal to the number of buckets
    if (new_nelems > old_nbuckets) {
        int new_nbuckets = i32_Max(algo::BumpToPow2(new_nelems), u32(4));
        u32 old_size = old_nbuckets * sizeof(atf_ci::FSsimfile*);
        u32 new_size = new_nbuckets * sizeof(atf_ci::FSsimfile*);
        // allocate new array. we don't use Realloc since copying is not needed and factor of 2 probably
        // means new memory will have to be allocated anyway
        atf_ci::FSsimfile* *new_buckets = (atf_ci::FSsimfile**)algo_lib::malloc_AllocMem(new_size);
        if (UNLIKELY(!new_buckets)) {
            FatalErrorExit("atf_ci.out_of_memory  field:atf_ci.FDb.ind_ssimfile");
        }
        memset(new_buckets, 0, new_size); // clear pointers
        // rehash all entries
        for (int i = 0; i < _db.ind_ssimfile_buckets_n; i++) {
            atf_ci::FSsimfile* elem = _db.ind_ssimfile_buckets_elems[i];
            while (elem) {
                atf_ci::FSsimfile &row        = *elem;
                atf_ci::FSsimfile* next       = row.ind_ssimfile_next;
                u32 index          = algo::Smallstr50_Hash(0, row.ssimfile) & (new_nbuckets-1);
                row.ind_ssimfile_next     = new_buckets[index];
                new_buckets[index] = &row;
                elem               = next;
            }
        }
        // free old array
        algo_lib::malloc_FreeMem(_db.ind_ssimfile_buckets_elems, old_size);
        _db.ind_ssimfile_buckets_elems = new_buckets;
        _db.ind_ssimfile_buckets_n = new_nbuckets;
    }
}

