// --- atf_ci.FDb.scriptfile.XrefMaybe
// Insert row into all appropriate indices. If error occurs, store error
// in algo_lib::_db.errtext and return false. Caller must Delete or Unref such row.
bool atf_ci::scriptfile_XrefMaybe(atf_ci::FScriptfile &row) {
    bool retval = true;
    (void)row;
    // insert scriptfile into index ind_scriptfile
    if (true) { // user-defined insert condition
        bool success = ind_scriptfile_InsertMaybe(row);
        if (UNLIKELY(!success)) {
            ch_RemoveAll(algo_lib::_db.errtext);
            algo_lib::_db.errtext << "atf_ci.duplicate_key  xref:atf_ci.FDb.ind_scriptfile"; // check for duplicate key
            return false;
        }
    }
    atf_ci::FGitfile* p_gitfile = atf_ci::ind_gitfile_Find(row.gitfile);
    if (UNLIKELY(!p_gitfile)) {
        algo_lib::ResetErrtext() << "atf_ci.bad_xref  index:atf_ci.FDb.ind_gitfile" << Keyval("key", row.gitfile);
        return false;
    }
    // insert scriptfile into index c_scriptfile
    if (true) { // user-defined insert condition
        bool success = c_scriptfile_InsertMaybe(*p_gitfile, row);
        if (UNLIKELY(!success)) {
            ch_RemoveAll(algo_lib::_db.errtext);
            algo_lib::_db.errtext << "atf_ci.duplicate_key  xref:atf_ci.FGitfile.c_scriptfile"; // check for duplicate key
            return false;
        }
    }
    return retval;
}

// --- atf_ci.FDb.ind_scriptfile.Find
// Find row by key. Return NULL if not found.
atf_ci::FScriptfile* atf_ci::ind_scriptfile_Find(const algo::strptr& key) {
    u32 index = algo::Smallstr200_Hash(0, key) & (_db.ind_scriptfile_buckets_n - 1);
    atf_ci::FScriptfile* *e = &_db.ind_scriptfile_buckets_elems[index];
    atf_ci::FScriptfile* ret=NULL;
    do {
        ret       = *e;
        bool done = !ret || (*ret).gitfile == key;
        if (done) break;
        e         = &ret->ind_scriptfile_next;
    } while (true);
    return ret;
}

// --- atf_ci.FDb.ind_scriptfile.FindX
// Look up row by key and return reference. Throw exception if not found
atf_ci::FScriptfile& atf_ci::ind_scriptfile_FindX(const algo::strptr& key) {
    atf_ci::FScriptfile* ret = ind_scriptfile_Find(key);
    vrfy(ret, tempstr() << "atf_ci.key_error  table:ind_scriptfile  key:'"<<key<<"'  comment:'key not found'");
    return *ret;
}

// --- atf_ci.FDb.ind_scriptfile.InsertMaybe
// Insert row into hash table. Return true if row is reachable through the hash after the function completes.
bool atf_ci::ind_scriptfile_InsertMaybe(atf_ci::FScriptfile& row) {
    ind_scriptfile_Reserve(1);
    bool retval = true; // if already in hash, InsertMaybe returns true
    if (LIKELY(row.ind_scriptfile_next == (atf_ci::FScriptfile*)-1)) {// check if in hash already
        u32 index = algo::Smallstr200_Hash(0, row.gitfile) & (_db.ind_scriptfile_buckets_n - 1);
        atf_ci::FScriptfile* *prev = &_db.ind_scriptfile_buckets_elems[index];
        do {
            atf_ci::FScriptfile* ret = *prev;
            if (!ret) { // exit condition 1: reached the end of the list
                break;
            }
            if ((*ret).gitfile == row.gitfile) { // exit condition 2: found matching key
                retval = false;
                break;
            }
            prev = &ret->ind_scriptfile_next;
        } while (true);
        if (retval) {
            row.ind_scriptfile_next = *prev;
            _db.ind_scriptfile_n++;
            *prev = &row;
        }
    }
    return retval;
}

// --- atf_ci.FDb.ind_scriptfile.Remove
// Remove reference to element from hash index. If element is not in hash, do nothing
void atf_ci::ind_scriptfile_Remove(atf_ci::FScriptfile& row) {
    if (LIKELY(row.ind_scriptfile_next != (atf_ci::FScriptfile*)-1)) {// check if in hash already
        u32 index = algo::Smallstr200_Hash(0, row.gitfile) & (_db.ind_scriptfile_buckets_n - 1);
        atf_ci::FScriptfile* *prev = &_db.ind_scriptfile_buckets_elems[index]; // addr of pointer to current element
        while (atf_ci::FScriptfile *next = *prev) {                          // scan the collision chain for our element
            if (next == &row) {        // found it?
                *prev = next->ind_scriptfile_next; // unlink (singly linked list)
                _db.ind_scriptfile_n--;
                row.ind_scriptfile_next = (atf_ci::FScriptfile*)-1;// not-in-hash
                break;
            }
            prev = &next->ind_scriptfile_next;
        }
    }
}

// --- atf_ci.FDb.ind_scriptfile.Reserve
// Reserve enough room in the hash for N more elements. Return success code.
void atf_ci::ind_scriptfile_Reserve(int n) {
    u32 old_nbuckets = _db.ind_scriptfile_buckets_n;
    u32 new_nelems   = _db.ind_scriptfile_n + n;
    // # of elements has to be roughly equal to the number of buckets
    if (new_nelems > old_nbuckets) {
        int new_nbuckets = i32_Max(algo::BumpToPow2(new_nelems), u32(4));
        u32 old_size = old_nbuckets * sizeof(atf_ci::FScriptfile*);
        u32 new_size = new_nbuckets * sizeof(atf_ci::FScriptfile*);
        // allocate new array. we don't use Realloc since copying is not needed and factor of 2 probably
        // means new memory will have to be allocated anyway
        atf_ci::FScriptfile* *new_buckets = (atf_ci::FScriptfile**)algo_lib::malloc_AllocMem(new_size);
        if (UNLIKELY(!new_buckets)) {
            FatalErrorExit("atf_ci.out_of_memory  field:atf_ci.FDb.ind_scriptfile");
        }
        memset(new_buckets, 0, new_size); // clear pointers
        // rehash all entries
        for (int i = 0; i < _db.ind_scriptfile_buckets_n; i++) {
            atf_ci::FScriptfile* elem = _db.ind_scriptfile_buckets_elems[i];
            while (elem) {
                atf_ci::FScriptfile &row        = *elem;
                atf_ci::FScriptfile* next       = row.ind_scriptfile_next;
                u32 index          = algo::Smallstr200_Hash(0, row.gitfile) & (new_nbuckets-1);
                row.ind_scriptfile_next     = new_buckets[index];
                new_buckets[index] = &row;
                elem               = next;
            }
        }
        // free old array
        algo_lib::malloc_FreeMem(_db.ind_scriptfile_buckets_elems, old_size);
        _db.ind_scriptfile_buckets_elems = new_buckets;
        _db.ind_scriptfile_buckets_n = new_nbuckets;
    }
}

