// --- atf_ci.FDb.cfg.AllocMem
// Allocate space for one element. If no memory available, return NULL.
void* atf_ci::cfg_AllocMem() {
    u64 new_nelems     = _db.cfg_n+1;
    // compute level and index on level
    u64 bsr   = algo::u64_BitScanReverse(new_nelems);
    u64 base  = u64(1)<<bsr;
    u64 index = new_nelems-base;
    void *ret = NULL;
    // if level doesn't exist yet, create it
    atf_ci::FCfg*  lev   = NULL;
    if (bsr < 32) {
        lev = _db.cfg_lary[bsr];
        if (!lev) {
            lev=(atf_ci::FCfg*)algo_lib::malloc_AllocMem(sizeof(atf_ci::FCfg) * (u64(1)<<bsr));
            _db.cfg_lary[bsr] = lev;
        }
    }
    // allocate element from this level
    if (lev) {
        _db.cfg_n = i32(new_nelems);
        ret = lev + index;
    }
    return ret;
}

// --- atf_ci.FDb.cfg.RemoveAll
// Remove all elements from Lary
void atf_ci::cfg_RemoveAll() {
    for (u64 n = _db.cfg_n; n>0; ) {
        n--;
        cfg_qFind(u64(n)).~FCfg(); // destroy last element
        _db.cfg_n = i32(n);
    }
}

// --- atf_ci.FDb.cfg.RemoveLast
// Delete last element of array. Do nothing if array is empty.
void atf_ci::cfg_RemoveLast() {
    u64 n = _db.cfg_n;
    if (n > 0) {
        n -= 1;
        cfg_qFind(u64(n)).~FCfg();
        _db.cfg_n = i32(n);
    }
}

