// --- atf_ci.FDb.ind_builddir.Find
// Find row by key. Return NULL if not found.
atf_ci::FBuilddir* atf_ci::ind_builddir_Find(const algo::strptr& key) {
    u32 index = algo::Smallstr50_Hash(0, key) & (_db.ind_builddir_buckets_n - 1);
    atf_ci::FBuilddir* *e = &_db.ind_builddir_buckets_elems[index];
    atf_ci::FBuilddir* ret=NULL;
    do {
        ret       = *e;
        bool done = !ret || (*ret).builddir == key;
        if (done) break;
        e         = &ret->ind_builddir_next;
    } while (true);
    return ret;
}

// --- atf_ci.FDb.ind_builddir.FindX
// Look up row by key and return reference. Throw exception if not found
atf_ci::FBuilddir& atf_ci::ind_builddir_FindX(const algo::strptr& key) {
    atf_ci::FBuilddir* ret = ind_builddir_Find(key);
    vrfy(ret, tempstr() << "atf_ci.key_error  table:ind_builddir  key:'"<<key<<"'  comment:'key not found'");
    return *ret;
}

// --- atf_ci.FDb.ind_builddir.GetOrCreate
// Find row by key. If not found, create and x-reference a new row with with this key.
atf_ci::FBuilddir& atf_ci::ind_builddir_GetOrCreate(const algo::strptr& key) {
    atf_ci::FBuilddir* ret = ind_builddir_Find(key);
    if (!ret) { //  if memory alloc fails, process dies; if insert fails, function returns NULL.
        ret         = &builddir_Alloc();
        (*ret).builddir = key;
        bool good = builddir_XrefMaybe(*ret);
        if (!good) {
            builddir_RemoveLast(); // delete offending row, any existing xrefs are cleared
            ret = NULL;
        }
    }
    vrfy(ret, tempstr() << "atf_ci.create_error  table:ind_builddir  key:'"<<key<<"'  comment:'bad xref'");
    return *ret;
}

// --- atf_ci.FDb.ind_builddir.InsertMaybe
// Insert row into hash table. Return true if row is reachable through the hash after the function completes.
bool atf_ci::ind_builddir_InsertMaybe(atf_ci::FBuilddir& row) {
    ind_builddir_Reserve(1);
    bool retval = true; // if already in hash, InsertMaybe returns true
    if (LIKELY(row.ind_builddir_next == (atf_ci::FBuilddir*)-1)) {// check if in hash already
        u32 index = algo::Smallstr50_Hash(0, row.builddir) & (_db.ind_builddir_buckets_n - 1);
        atf_ci::FBuilddir* *prev = &_db.ind_builddir_buckets_elems[index];
        do {
            atf_ci::FBuilddir* ret = *prev;
            if (!ret) { // exit condition 1: reached the end of the list
                break;
            }
            if ((*ret).builddir == row.builddir) { // exit condition 2: found matching key
                retval = false;
                break;
            }
            prev = &ret->ind_builddir_next;
        } while (true);
        if (retval) {
            row.ind_builddir_next = *prev;
            _db.ind_builddir_n++;
            *prev = &row;
        }
    }
    return retval;
}

// --- atf_ci.FDb.ind_builddir.Remove
// Remove reference to element from hash index. If element is not in hash, do nothing
void atf_ci::ind_builddir_Remove(atf_ci::FBuilddir& row) {
    if (LIKELY(row.ind_builddir_next != (atf_ci::FBuilddir*)-1)) {// check if in hash already
        u32 index = algo::Smallstr50_Hash(0, row.builddir) & (_db.ind_builddir_buckets_n - 1);
        atf_ci::FBuilddir* *prev = &_db.ind_builddir_buckets_elems[index]; // addr of pointer to current element
        while (atf_ci::FBuilddir *next = *prev) {                          // scan the collision chain for our element
            if (next == &row) {        // found it?
                *prev = next->ind_builddir_next; // unlink (singly linked list)
                _db.ind_builddir_n--;
                row.ind_builddir_next = (atf_ci::FBuilddir*)-1;// not-in-hash
                break;
            }
            prev = &next->ind_builddir_next;
        }
    }
}

// --- atf_ci.FDb.ind_builddir.Reserve
// Reserve enough room in the hash for N more elements. Return success code.
void atf_ci::ind_builddir_Reserve(int n) {
    u32 old_nbuckets = _db.ind_builddir_buckets_n;
    u32 new_nelems   = _db.ind_builddir_n + n;
    // # of elements has to be roughly equal to the number of buckets
    if (new_nelems > old_nbuckets) {
        int new_nbuckets = i32_Max(algo::BumpToPow2(new_nelems), u32(4));
        u32 old_size = old_nbuckets * sizeof(atf_ci::FBuilddir*);
        u32 new_size = new_nbuckets * sizeof(atf_ci::FBuilddir*);
        // allocate new array. we don't use Realloc since copying is not needed and factor of 2 probably
        // means new memory will have to be allocated anyway
        atf_ci::FBuilddir* *new_buckets = (atf_ci::FBuilddir**)algo_lib::malloc_AllocMem(new_size);
        if (UNLIKELY(!new_buckets)) {
            FatalErrorExit("atf_ci.out_of_memory  field:atf_ci.FDb.ind_builddir");
        }
        memset(new_buckets, 0, new_size); // clear pointers
        // rehash all entries
        for (int i = 0; i < _db.ind_builddir_buckets_n; i++) {
            atf_ci::FBuilddir* elem = _db.ind_builddir_buckets_elems[i];
            while (elem) {
                atf_ci::FBuilddir &row        = *elem;
                atf_ci::FBuilddir* next       = row.ind_builddir_next;
                u32 index          = algo::Smallstr50_Hash(0, row.builddir) & (new_nbuckets-1);
                row.ind_builddir_next     = new_buckets[index];
                new_buckets[index] = &row;
                elem               = next;
            }
        }
        // free old array
        algo_lib::malloc_FreeMem(_db.ind_builddir_buckets_elems, old_size);
        _db.ind_builddir_buckets_elems = new_buckets;
        _db.ind_builddir_buckets_n = new_nbuckets;
    }
}

