// --- atf_ci.TableId.value.SetStrptrMaybe
// Convert string to field.
// If the string is invalid, do not modify field and return false.
// In case of success, return true
bool atf_ci::value_SetStrptrMaybe(atf_ci::TableId& parent, algo::strptr rhs) {
    bool ret = false;
    switch (elems_N(rhs)) {
        case 7: {
            switch (u64(algo::ReadLE32(rhs.elems))|(u64(algo::ReadLE16(rhs.elems+4))<<32)|(u64(rhs[6])<<48)) {
                case LE_STR7('d','e','v','.','C','f','g'): {
                    value_SetEnum(parent,atf_ci_TableId_dev_Cfg); ret = true; break;
                }
                case LE_STR7('d','e','v','.','c','f','g'): {
                    value_SetEnum(parent,atf_ci_TableId_dev_cfg); ret = true; break;
                }
            }
            break;
        }
        case 9: {
            switch (algo::ReadLE64(rhs.elems)) {
                case LE_STR8('d','m','m','e','t','a','.','N'): {
                    if (memcmp(rhs.elems+8,"s",1)==0) { value_SetEnum(parent,atf_ci_TableId_dmmeta_Ns); ret = true; break; }
                    break;
                }
                case LE_STR8('d','m','m','e','t','a','.','n'): {
                    if (memcmp(rhs.elems+8,"s",1)==0) { value_SetEnum(parent,atf_ci_TableId_dmmeta_ns); ret = true; break; }
                    break;
                }
            }
            break;
        }
        case 10: {
            switch (algo::ReadLE64(rhs.elems)) {
                case LE_STR8('d','e','v','.','R','e','a','d'): {
                    if (memcmp(rhs.elems+8,"me",2)==0) { value_SetEnum(parent,atf_ci_TableId_dev_Readme); ret = true; break; }
                    break;
                }
                case LE_STR8('d','e','v','.','S','s','i','m'): {
                    if (memcmp(rhs.elems+8,"fs",2)==0) { value_SetEnum(parent,atf_ci_TableId_dev_Ssimfs); ret = true; break; }
                    break;
                }
                case LE_STR8('d','e','v','.','r','e','a','d'): {
                    if (memcmp(rhs.elems+8,"me",2)==0) { value_SetEnum(parent,atf_ci_TableId_dev_readme); ret = true; break; }
                    break;
                }
                case LE_STR8('d','e','v','.','s','s','i','m'): {
                    if (memcmp(rhs.elems+8,"fs",2)==0) { value_SetEnum(parent,atf_ci_TableId_dev_ssimfs); ret = true; break; }
                    break;
                }
            }
            break;
        }
        case 11: {
            switch (algo::ReadLE64(rhs.elems)) {
                case LE_STR8('d','e','v','.','G','i','t','f'): {
                    if (memcmp(rhs.elems+8,"ile",3)==0) { value_SetEnum(parent,atf_ci_TableId_dev_Gitfile); ret = true; break; }
                    break;
                }
                case LE_STR8('d','e','v','.','M','s','g','f'): {
                    if (memcmp(rhs.elems+8,"ile",3)==0) { value_SetEnum(parent,atf_ci_TableId_dev_Msgfile); ret = true; break; }
                    break;
                }
                case LE_STR8('d','e','v','.','T','a','r','g'): {
                    if (memcmp(rhs.elems+8,"src",3)==0) { value_SetEnum(parent,atf_ci_TableId_dev_Targsrc); ret = true; break; }
                    break;
                }
                case LE_STR8('d','e','v','.','g','i','t','f'): {
                    if (memcmp(rhs.elems+8,"ile",3)==0) { value_SetEnum(parent,atf_ci_TableId_dev_gitfile); ret = true; break; }
                    break;
                }
                case LE_STR8('d','e','v','.','m','s','g','f'): {
                    if (memcmp(rhs.elems+8,"ile",3)==0) { value_SetEnum(parent,atf_ci_TableId_dev_msgfile); ret = true; break; }
                    break;
                }
                case LE_STR8('d','e','v','.','t','a','r','g'): {
                    if (memcmp(rhs.elems+8,"src",3)==0) { value_SetEnum(parent,atf_ci_TableId_dev_targsrc); ret = true; break; }
                    break;
                }
            }
            break;
        }
        case 12: {
            switch (algo::ReadLE64(rhs.elems)) {
                case LE_STR8('d','e','v','.','B','u','i','l'): {
                    if (memcmp(rhs.elems+8,"ddir",4)==0) { value_SetEnum(parent,atf_ci_TableId_dev_Builddir); ret = true; break; }
                    break;
                }
                case LE_STR8('d','e','v','.','N','o','i','n'): {
                    if (memcmp(rhs.elems+8,"dent",4)==0) { value_SetEnum(parent,atf_ci_TableId_dev_Noindent); ret = true; break; }
                    break;
                }
                case LE_STR8('d','e','v','.','b','u','i','l'): {
                    if (memcmp(rhs.elems+8,"ddir",4)==0) { value_SetEnum(parent,atf_ci_TableId_dev_builddir); ret = true; break; }
                    break;
                }
                case LE_STR8('d','e','v','.','n','o','i','n'): {
                    if (memcmp(rhs.elems+8,"dent",4)==0) { value_SetEnum(parent,atf_ci_TableId_dev_noindent); ret = true; break; }
                    break;
                }
            }
            break;
        }
        case 14: {
            switch (algo::ReadLE64(rhs.elems)) {
                case LE_STR8('d','e','v','.','S','c','r','i'): {
                    if (memcmp(rhs.elems+8,"ptfile",6)==0) { value_SetEnum(parent,atf_ci_TableId_dev_Scriptfile); ret = true; break; }
                    break;
                }
                case LE_STR8('d','e','v','.','s','c','r','i'): {
                    if (memcmp(rhs.elems+8,"ptfile",6)==0) { value_SetEnum(parent,atf_ci_TableId_dev_scriptfile); ret = true; break; }
                    break;
                }
            }
            break;
        }
        case 15: {
            switch (algo::ReadLE64(rhs.elems)) {
                case LE_STR8('d','m','m','e','t','a','.','S'): {
                    if (memcmp(rhs.elems+8,"simfile",7)==0) { value_SetEnum(parent,atf_ci_TableId_dmmeta_Ssimfile); ret = true; break; }
                    break;
                }
                case LE_STR8('d','m','m','e','t','a','.','s'): {
                    if (memcmp(rhs.elems+8,"simfile",7)==0) { value_SetEnum(parent,atf_ci_TableId_dmmeta_ssimfile); ret = true; break; }
                    break;
                }
            }
            break;
        }
    }
    return ret;
}

